import React, { Component } from 'react';
import Notifactions from './widgets/Notifactions'
import FamilyMemebers from './widgets/FamilyMembers'
import { Redirect } from 'react-router-dom'
import { connect } from 'react-redux'

const MemDashboard = (props) => {
  const { auth } = props;
  if(!auth.uid) return <Redirect to='/signin' />

  return (
    <div className="dashboard container">
        <div className="row">
            <div className="col s12 m6">
              <FamilyMemebers/>
            </div>
            <div className="col s12 m5 offset-m1">
              <Notifactions/>
            </div>
        </div>
    </div>
  );
}

const mapState = (state) => {
  return {
      auth: state.firebase.auth
  }
}

const mapDispatch = (dispatch) => {
  return {
      createFamily: (family) => dispatch(createFamily(family))
  }
}

export default connect(mapState, mapDispatch)(MemDashboard);
